import React from 'react';
import {Link} from 'react-router-dom';
import linkedinIcon from "./images/linkedin-icon.png";
import GithubIcon from "./images/github-icon.png";

export default function icons() {
    return (
        <div className="icons-div">
            <a
                href="https://www.linkedin.com/in/renato-pimentel/"
                rel="noopener noreferrer">
                <img src={linkedinIcon} alt="Linkedin Logo" className="linkedin-icon"/>
            </a>
            <a href="https://github.com/renatotabossi/" rel="noopener noreferrer">
                <img src={GithubIcon} alt="GitHub Logo" className="github-icon"/>
            </a>
        </div>
    )
}
